import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the sort/filter controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Try multiple selector strategies to find the List View button
    // 1. By class and title
    let listViewBtn = await page.$('.view-btn[title="List View"]');
    // 2. By button text (if icon missing)
    if (!listViewBtn) {
      listViewBtn = await page.$('//button[contains(@class, "view-btn") and contains(., "List")]');
    }
    // 3. By nth-of-type (second .view-btn)
    if (!listViewBtn) {
      const btns = await page.$$('.view-btn');
      if (btns.length > 1) listViewBtn = btns[1];
    }

    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to List View
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Extract some data to verify List View mode
    const listViewExists = await page.$('.products-list') !== null;
    const productCardsList = await page.$$('.product-card-list');
    const numListItems = productCardsList.length;

    return {
      success: true,
      action: "Switched to List View Mode by clicking the List View button and verified products are in list layout.",
      extractedData: {
        listViewContainerFound: listViewExists,
        numberOfListItems: numListItems
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
